import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ITEquipment.css';

const ITEquipment = () => {
  const [itEquipments, setITEquipments] = useState([]);
  const [newEquipment, setNewEquipment] = useState({
    categorie: '',
    marque: '',
    model: '',
    code_materiel: '',
    serie: '',
    code_localisation: '',
    code_entite: '',
    date_installation: '',
    fin_garantie: '',
    statut: '',
    type_acquisition: '',
    date_achat: '',
    date_livraison: '',
    fournisseur: '',
    numero_facture: '',
    prix_achat: '',
    numero_appel_offre: '',
    numero_livraison: '',
    cout_maintenance: '',
    emploi_principal: '',
    niveau_criticite: '',
    sla: '',
    date_sortie: '',
  });

  useEffect(() => {
    const fetchITEquipments = async () => {
      try {
        const response = await axios.get('/api/it-equipments');
        setITEquipments(response.data);
      } catch (error) {
        console.error('Error fetching IT Equipments:', error);
      }
    };

    fetchITEquipments();
  }, []);

  const handleAddEquipment = async () => {
    try {
      const response = await axios.post('/api/it-equipments', newEquipment);
      setITEquipments([...itEquipments, response.data]);
      setNewEquipment({
        categorie: '',
        marque: '',
        model: '',
        code_materiel: '',
        serie: '',
        code_localisation: '',
        code_entite: '',
        date_installation: '',
        fin_garantie: '',
        statut: '',
        type_acquisition: '',
        date_achat: '',
        date_livraison: '',
        fournisseur: '',
        numero_facture: '',
        prix_achat: '',
        numero_appel_offre: '',
        numero_livraison: '',
        cout_maintenance: '',
        emploi_principal: '',
        niveau_criticite: '',
        sla: '',
        date_sortie: '',
      });
      alert('Equipment added successfully!');
    } catch (error) {
      console.error('Error adding IT Equipment:', error);
    }
  };

  const handleDeleteEquipment = async (id) => {
    try {
      await axios.delete(`/api/it-equipments/${id}`);
      setITEquipments(itEquipments.filter(equipment => equipment.id !== id));
    } catch (error) {
      console.error('Error deleting IT Equipment:', error);
    }
  };

  const handleChange = (e) => {
    setNewEquipment({ ...newEquipment, [e.target.name]: e.target.value });
  };

  return (
    <div className="it-equipment-manager">
      <h1>IT Equipment Manager</h1>
      <div className="add-equipment">
        {Object.keys(newEquipment).map((key) => (
          <input
            key={key}
            type="text"
            name={key}
            value={newEquipment[key]}
            onChange={handleChange}
            placeholder={key.replace(/_/g, ' ')}
          />
        ))}
        <button onClick={handleAddEquipment}>Add Equipment</button>
      </div>
      <div className="table-container">
        <div className="data-table vertical">
          {itEquipments.map((equipment, index) => (
            <div key={equipment.id} className="data-row">
              <div className="data-row-header">#</div>
              <div className="data-row-content">{index + 1}</div>
              <div className="data-row-header">Categorie</div>
              <div className="data-row-content">{equipment.categorie}</div>
              <div className="data-row-header">Marque</div>
              <div className="data-row-content">{equipment.marque}</div>
              <div className="data-row-header">Model</div>
              <div className="data-row-content">{equipment.model}</div>
              <div className="data-row-header">Code Materiel</div>
              <div className="data-row-content">{equipment.code_materiel}</div>
              <div className="data-row-header">Serie</div>
              <div className="data-row-content">{equipment.serie}</div>
              <div className="data-row-header">Code Localisation</div>
              <div className="data-row-content">{equipment.code_localisation}</div>
              <div className="data-row-header">Code Entite</div>
              <div className="data-row-content">{equipment.code_entite}</div>
              <div className="data-row-header">Date Installation</div>
              <div className="data-row-content">{equipment.date_installation}</div>
              <div className="data-row-header">Fin Garantie</div>
              <div className="data-row-content">{equipment.fin_garantie}</div>
              <div className="data-row-header">Statut</div>
              <div className="data-row-content">{equipment.statut}</div>
              <div className="data-row-header">Type Acquisition</div>
              <div className="data-row-content">{equipment.type_acquisition}</div>
              <div className="data-row-header">Date Achat</div>
              <div className="data-row-content">{equipment.date_achat}</div>
              <div className="data-row-header">Date Livraison</div>
              <div className="data-row-content">{equipment.date_livraison}</div>
              <div className="data-row-header">Fournisseur</div>
              <div className="data-row-content">{equipment.fournisseur}</div>
              <div className="data-row-header">Numero Facture</div>
              <div className="data-row-content">{equipment.numero_facture}</div>
              <div className="data-row-header">Prix Achat</div>
              <div className="data-row-content">{equipment.prix_achat}</div>
              <div className="data-row-header">Numero Appel Offre</div>
              <div className="data-row-content">{equipment.numero_appel_offre}</div>
              <div className="data-row-header">Numero Livraison</div>
              <div className="data-row-content">{equipment.numero_livraison}</div>
              <div className="data-row-header">Cout Maintenance</div>
              <div className="data-row-content">{equipment.cout_maintenance}</div>
              <div className="data-row-header">Emploi Principal</div>
              <div className="data-row-content">{equipment.emploi_principal}</div>
              <div className="data-row-header">Niveau Criticite</div>
              <div className="data-row-content">{equipment.niveau_criticite}</div>
              <div className="data-row-header">SLA</div>
              <div className="data-row-content">{equipment.sla}</div>
              <div className="data-row-header">Date Sortie</div>
              <div className="data-row-content">{equipment.date_sortie}</div>
              <button onClick={() => handleDeleteEquipment(equipment.id)}>Delete</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default ITEquipment;
